import React from "react";
import {
  SidebarContainer,
  ExitButton,
  Slideshow,
  SidebarContent,
} from "./styles";

const Sidebar = () => {
  return (
    <SidebarContainer>
      <ExitButton />
      <Slideshow />
      <SidebarContent />
    </SidebarContainer>
  );
};

export default Sidebar;
